import React from "react";

function Logout() {
  function handleLogout() {
    fetch("https://pure-anchorage-05380.herokuapp.com/user_logout", {
      method: "DELETE"
    })
      .then((response) => response.json())
      .then((data) => {
        console.log(data);
        localStorage.clear();
      });
  }

  return (
    <header>
      <button onClick={handleLogout}>Logout</button>
    </header>
  );
}

export default Logout;
